import React from 'react';
import ReactDOM from 'react-dom';
// import './App.css';
import App from './App';
import Home from './Home';
import { BrowserRouter } from "react-router-dom"

const root = ReactDOM.createRoot(document.getElementById("root"))
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <App 
      />
      <Home/>
    </BrowserRouter>
  </React.StrictMode>
)
